<!DOCTYPE html>
<html lang="pl">

<head>
	<meta charset="UTF-8">
	<meta name="viewport" content="width=device-width,initial-scale=1">

	<link rel="apple-touch-icon" sizes="180x180" href="/apple-touch-icon.png">
	<link rel="icon" type="image/png" sizes="32x32" href="/icon32.png">
	<link rel="icon" type="image/png" sizes="16x16" href="/icon16.png">
	<link rel="manifest" href="/site.webmanifest">
	<meta name="theme-color" content="#c1e2fd">

	<link rel="preconnect" href="https://fonts.googleapis.com">
	<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
	<link href="https://fonts.googleapis.com/css2?family=Lato:wght@400;700&family=Lexend+Deca&display=swap" rel="stylesheet">

	<style type="text/css">
		html, body {
			height: 100%;
			margin: 0;
			background: radial-gradient(transparent, #c1e2fd);
			font-family: 'Lato', sans-serif;
			overflow: hidden;
		}

		@keyframes fade {
			0%   { opacity: 0; }
			100% { opacity: 1; }
		}
		
		body {
			position: relative;
			display: flex;
			animation: fade 800ms ease-in-out;
		}

		.page {
			display: flex; flex-direction: column; align-items: center; gap: 20px;
			width: 100%;
			overflow-y: auto;
		}

		.flex {
			display: flex; align-items: center; gap: 0.4em;
		}

		svg { height: 1em; }
		
		h1, h2, h3, h4, h5 {
			font-family: 'Lexend Deca', sans-serif;
			margin: 0;
			overflow-wrap: anywhere;
			text-align: center;
		}

		a {
			color: inherit;
			text-decoration: none;
			transition: transform 50ms;
		}

			a:active {
				transform: translateY(2px);
			}

		h1 {
			margin-top: 50px;
			font-size: 100px;
		}

		h2 { font-size: 70px; }

		@media only screen and (max-width: 600px) {
			h1 { font-size: 60px; }
			h2 { font-size: 30px; }

			#buttons {
				width: 80%;
				flex-direction: column;
			}

			.button-prim, .button-sec {
				justify-content: center;
				width: 100%;
				box-sizing: border-box;
			}
		}

		.flake {
			position: absolute;
			pointer-events: none;
			user-select: none;
			opacity: 0.4;
			z-index: -1;
		}

		#buttons {
			display: flex; gap: 10px;
		}
		
		.button-prim, .button-sec {
			padding: 20px 30px;
			border-radius: 10px;
			font-size: 20px;
			border-width: 1px;
			border-style: solid;
		}

			.button-prim[disabled], .button-sec[disabled] {
				opacity: 0.4;
				pointer-events: none;
			}

		.button-prim {
			color: white;
			background: linear-gradient(297deg, #e30613, #ff6770);
		}

			.button-prim:not([disabled]):hover {
				color: black;
				border-color: #e30613;
				background: #e3061326;
			}

		.button-sec {
			border-color:gray;
		}

			.button-sec:not([disabled]):hover {
				border-color: #e30613;
				background: #e3061326;
			}

		#slides {
			overflow-x: hidden;
			width: 100%; height: 300px;
			max-width: 2000px;
			border-radius: 10px;
			flex-shrink: 0;
		}
		
			#slides > div {
				display: flex; justify-content: center; align-items: center; gap: 10px;
				height: 100%;
			}

				#slides > div > img {
					height: 80%;
					border-radius: 10px;
					transition: height 200ms;
					cursor: pointer;
				}

					#slides > div > img:hover {
						height: 100%;
					}

		.bg {
			position: absolute;
			display: flex; justify-content: center; align-items: center;
			width: 100%; height: 100%;
			background: #00000080;
			animation: fade 200ms;
		}

			const slide = document.querySelector('#slides > div');
			let hovering = true;
			let viewing = false;
			let width = -10;
			for (const child of slide.children) {
				child.addEventListener('mouseenter', () => { hovering = false; });
				child.addEventListener('mouseleave', () => { hovering = true; });
				child.addEventListener('click', () => {
					viewing = true;
					const elem = document.createElement('div');
					elem.addEventListener('click', () => {
						viewing = false;
						elem.remove();
					});
					elem.classList.add('bg');
					const img = document.createElement('img');
					img.src = child.src;
					elem.appendChild(img);
					document.body.appendChild(elem);
				});
				width += child.width + 10;
			}
			width /= 2;
			let lastTime = Date.now(); 
			let x = 0;

			setInterval(() => {
				if (document.visibilityState === 'visible') {
					const time = Date.now();
						for (let i = 0; i < flakes.length; ++i) {
							const flake = flakes[i];
							const flakeTime = (time - flake.time) / 80;
							if (flakeTime >= 150) {
								flake.remove();
								flakes.splice(i, 1);
								continue;
							}
							flake.style.top = `${flakeTime}%`;
						}
					
					if (hovering && !viewing) {
						x += (time - lastTime) / 10;
					}
					lastTime =time;
					slide.style.transform = `translateX(${-((x % width) - width / 2)}px)`;
				}
			}, 0);
		});
